import React from 'react';
import { Marker, Popup, TleLayer, MapContainer, TileLayer, useMap } from 'react-leaflet'



class App extends React.Component {
  render() {
    return
    <MapContainer center={[2.9345042076964605, -75.28090319052527]}>
      <TileLayer
        url="https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png"
        attribution='&copy; <a href="http://osm.org/copyright">OpenStreetMap</a> contributors'
      />
    </MapContainer>
  }
}
export default App;
